import './App.scss';
import Header from './Header/Header.jsx';
import Section from './Section/Section';
import Aside from './Aside/Aside';
import Aside_Profile from './Aside_Profile/Aside_Profile';
import { BrowserRouter, Route } from 'react-router-dom';
import Aside_News from './Aside_News/Aside_News';

const App=(props)=> {
  return (
    <BrowserRouter>
    <div className="App">
    <Header></Header>
    <Section></Section>
    <Route path='/aside' render={()=><Aside DialogsData={props.DialogsData} MessagesData={props.MessagesData}></Aside>}></Route>
    <Route path='/profile' component={Aside_Profile}></Route>
    <Route path="" render={()=><Aside_News></Aside_News>}></Route>
 </div>
 </BrowserRouter>
  );
}

export default App;
